snippet.description:
There are more older people living in our society today than ever before and this number is set to grow.

Jewish Care works with thousands of older people every week. 

We run care homes and day centres; 

We offer advice and support through our helpline and community support teams; 

We visit clients in their homes;

We provide support to their loved ones who are caring for them. 

But we need your support.

